import Header from '../components/header.js';
import Footer from '../components/footer.js';
import registerimg from '../SURSE/imagini-use/register.jpg';

function Account()
{
    return(
<>
<Header />
<div className='w-full h-[539px] relative flex items-center justify-center'>
<div className='bg-black relative flex w-[800px] h-[400px] rounded-xl drop-shadow-3xl'>
        <div className='relative flex flex-col h-full w-1/2 bg-gray-300 items-center'>
        <h1 className='font-bold text-center mt-5 text-5xl font-italianno'>Login</h1>
            <div className='bg-gray-100 relative flex flex-col w-3/4 h-52 mt-2'>
            <form>
                <input type='text' placeholder='&#9993; Enter your email' className='bg-gray-50 mb-5 drop-shadow-3xl rounded border-black border-b-2' required />
                <input type='text' placeholder='&#128274; Enter your password' className='bg-gray-50 drop-shadow-3xl rounded border-black border-b-2' required />
            </form>
            </div>

        </div>

        <div className='relative h-full w-1/2 bg-gray-500'>
        <img src={registerimg} className="w-full h-full" />
        </div>
</div>
</div>
<Footer />
</>
    );
}

export default Account;
